import myImg from '../myImg.jpg';
import './Home.css';
function Home(){
    return(
        <div className="wrapper">
            <section>
                <img src={myImg} className="my-Img"/>
                <div className="img-info"> 
                    <h1>Marc Albert<span> Bautista</span></h1>
                    <p>Your Aspiring Full-Stack Developer</p>
                    <a href="https://www.facebook.com/Peppapigmacmac" target="_blank">Download CV</a>
                </div>
            </section>
        </div>
    );
}
export default Home
